import React from "react";

function Card(props) {
  return (
    <div className="card">
      <div className="top">
        <h1 className="name">{props.name}</h1>
        <img className="circle-img" src={props.img} />
        <img />
      </div>
      <div className="bottom">
        <p className="info">{props.phoneNumber}</p>
        <p className="info">{props.email}</p>
      </div>
    </div>
  );
}

export default Card;
